Looks like Albo laid a bad egg when he suggested a bipartisan agreement with ScoMo on how to manage energy investment and emissions-reduction targets. 

Albo was being foxy; he offered cooperation  without mentioning “reliable and affordable energy”, which is ScoMo’s mantra. Plus Labor did not rule out their favourite, a carbon tax, either an explicit one or a sneaky one, which Angus Taylor exposed in the video, adding that there were many ways to bring in a sneaky carbon tax. He knows. He was in Turnbull’s Outer Ministry. 

It’s not only Labor we need to fear. Many Liberals and even  Nationals who sit on the parliamentary front bench are “moderates”, which really means leftist infiltrators into the conservative coalition, and they present themselves as innocent and trustworthy as  children in a kindergarten pen ... but they’re up to their eyeballs in the Marxist globalist Climate Change scam. Not only in the way they don’t expose it for the hoax it is but also by complying with the demands of Paris agreement instead of leaving this UN trap, Trump-style. But maybe ScoMo is unwilling to face the Marxist war that Trump has had to wage. Maybe he has another way? Maybe. 

It’s a shame that a conservative at heart like Angus Taylor, with conservative family history, gas-bags about the government’s  “Climate Solution Fund”. 
Just shows how firm is the Marxist grip on our throats at the moment, which they tightened through years of infiltration and covert indoctrination.  

When Marxist UN official, Costa Rican Christiana Figueres, was still executive secretary at UN’s Framework Convention on Climate Change, she said at a conference in Brussels (2017) that their goal was to destroy capitalism, not to save the world from ecological calamity. Google it to check. It’s out in the open. Not a secret.  

Other Marxists  also admitted that the Climate Change war WASN’T about the climate but for transferring wealth out of Western nations. Which means for transferring our hard-earned money into UN’s communistic projects. 

Have our government ministers ever taken the trouble to read the articles and watch the videos from top climate scientists who are climate sceptics? People like: 
* Nils-Axel Mörner—retired head of paleo-geophysics & geodymamics department at Sweden University, sea-level reviewer for the UN Intergovernmental Panel for Climate Change (IPCC) in 2000—who debunked UN IPCC lies;
* Patrick Moore, co-founder of the Green Peace movement—who explained how this movement changed and took on false and incorrect assumptions;  
* Will Haper, emeritus professor st Princeton University—who exposed how climate change scientists became political activists who deliberately manipulate climate models and use data that gives them the results they want; 
* Patrick J. Michaels, Director of CATO Institute Center for the Study of Science—who exposed the truth about  global warming (and it’s not what you hear from that button-eyed opportunistic clown Flannery);
* Prof Judith Curry—who made a list of facts against CO2-based climate change ideology;
* Hal Doiron, Leighton Steward, Tom Wysmuller, Walter Cunningham, the four former NASA scientists—who trashed the global warming hysteria;
* Steven Goreham, Executive Director of the Climate Science Coalition of America —author of Climate Science and the Myths of Renewable Energy;
* Ian Rutherford Plimer, Australian geologist and professor emeritus of Earth Sciences at the University of Melbourne, previously a professor of Mining Geology at the University of Adelaide, and the director of multiple mineral exploration and mining companies—who declared that people who push the warmist climate bandwagon base their arguments on a false premise. Professor Plimer’s recent book Climate Change Delusion and the Great Electricity Rip-Off' explains why our electricity prices are the highest in the world despite Australia being so resource-rich.
* Dr. Willie Soon, solar scientist—who has spent nearly three decades researching the influence of the Sun on climate and concluded that our Sun controls our climate. Not human activity; 
* Prof. Ivar Giaever, a Norwegian-American physicist and Nobel Laureate in Physics-—who called  "Global Warming” a pseudoscience. (Pseudo-science is when someone starts with a hypothesis and then looks only at things which confirm this hypothesis, he said);
* Prof. Bob Carter—who presented 10 facts & 10 myths about climate change;
* Astrophysicist Piers Corbyn—who explained that the Sun rules sea temperature and the sea temperature rules the climate. GLOBAL COOLING HAS ALREADY STARTED, he also said. There is a change in solar activity that will cause a mini ice age by 2030, which will last for about 30 years. Temperatures may start dropping in 2021.

